import "./index.css";

function Footer() {
  const date = new Date().getFullYear();
  return (
    <footer className="bg-gray-800 py-3 text-center absolute mb-0 w-full">
      <p>Designed by Naveen Mandava, Copyright @ {date}</p>
    </footer>
  );
}

export default Footer;
